    render() {
        return (
            <div style ={{padding: "20px"}}>
                <div style = {{padding: "20px", border: "2px"}} >
                    <img style = {{width: "100px", height: "100px", border: "2px", padding: "10px"}}/>
                    <h1>A</h1>
                    <h1>D {this.prop.programImage} </h1>
                    <h1>B</h1>
                </div>
            </div>
        );
    }
});
